  return (
    <div>
      <h1>Error 404 - Page Not Found</h1>
      <img
        // className={PageNotFound}
        src={dogePageNotFound}
        alt="Error 404 Doge Crying"
      />
      {/* <img
        src={require("../client/src/images/cryingcat.png")}
        alt={"main-img"}
      /> */}
    </div>
  );
};

export default PageNotFound;
